import React from "react"

import {BrowserRouter as Router, Route} from "react-router-dom";

import {Login} from ""

class App extends React.Component {
  render() {
    return (
      <div style={{fontFamily: "Poppins"}}>
        <Router>
          <Route path={"/chats"} component={Login}/>
        </Router>
      </div>
    )
  }
}

export default App
